import React from 'react';
import { Link } from 'react-router-dom';

const MainPage = () => {
  return (
    <div>
      <h2>Добро пожаловать на главную страницу</h2>
      <p>Это пример главной страницы вашего приложения.</p>
      <p>Вы можете перейти на страницу нотариусов, кликнув на эту ссылку:</p>
      <Link to="/notaries">Перейти к нотариусам</Link>
    </div>
  );
};

export default MainPage;
